import React from 'react';
import './Card.css'

function Card() {
    return (
        <div classNames="card">
            <img src="" alt="Avatar" style="width:100%" />
            <div className="container" >
                <h4><b>Jane Doe</b></h4> 
                <p>Interior Designer</p> 
            </div>
        </div>
    )
}

export default Card;
